import React, { useState } from 'react';
import './GridEntry.scss';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';

// Official 2026 Lineups
const f1Data: { [key: string]: string[] } = {
  "McLaren": ["Lando Norris", "Oscar Piastri"],
  "Ferrari": ["Charles Leclerc", "Lewis Hamilton"],
  "Red Bull": ["Max Verstappen", "Isack Hadjar"],
  "Mercedes": ["George Russell", "Kimi Antonelli"],
  "Aston Martin": ["Fernando Alonso", "Lance Stroll"],
  "Audi": ["Nico Hülkenberg", "Gabriel Bortoleto"],
  "Williams": ["Alex Albon", "Carlos Sainz"],
  "Alpine": ["Pierre Gasly", "Franco Colapinto"],
  "Haas": ["Esteban Ocon", "Oliver Bearman"],
  "Racing Bulls": ["Liam Lawson", "Arvid Lindblad"],
  "Cadillac": ["Sergio Pérez", "Valtteri Bottas"]
};

// Mock data for the Results View
const voterData = [
  { id: 1, name: "Shailee Patel", team: "McLaren", driver: "Lando Norris", timestamp: "12:37:06" },
  { id: 2, name: "Alex Chen", team: "Ferrari", driver: "Lewis Hamilton", timestamp: "11:20:15" },
  { id: 3, name: "Jordan Smith", team: "Red Bull", driver: "Max Verstappen", timestamp: "09:45:30" },
];

const GridEntry = () => {
  const [step, setStep] = useState(1); // 1: Objective, 2: Form, 3: Results
  const [formData, setFormData] = useState({ name: '', team: '', driver: '' });

  const handleTeamChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    setFormData({ ...formData, team: e.target.value, driver: '' });
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div className="grid-entry-container" id="contact" style={{ backgroundColor: '#FAFAF8', padding: '100px 10%' }}>
      <div className="main-content-area" style={{ display: 'flex', justifyContent: 'center' }}>
        <div className="f1-terminal" style={{ 
          backgroundColor: '#1E1E1E', width: '100%', 
          maxWidth: step === 3 ? '1200px' : '800px', // Expand width for results
          minHeight: '450px', borderRadius: '4px', padding: '40px', position: 'relative',
          boxShadow: '20px 20px 0px #FF7A1A', transition: 'max-width 0.5s ease'
        }}>

          {/* STEP 1: MISSION OBJECTIVE */}
          {step === 1 && (
            <div className="terminal-content">
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '20px' }}>{'>'} MISSION_OBJECTIVE</h2>
              <p style={{ color: '#FAFAF8', lineHeight: '1.8', fontSize: '1.1rem', marginBottom: '30px' }}>
                Why F1? For me, software engineering is about performance architecture. 
                Just as a race engineer monitors thousands of data points to find an extra tenth of a second, 
                I build systems that optimize for precision and reliability.
              </p>
              <div style={{ display: 'flex', gap: '20px' }}>
                <button onClick={() => setStep(2)} className="btn-primary">
                  JOIN THE GRID <ArrowForwardIosIcon style={{ fontSize: '14px' }} />
                </button>
                <button onClick={() => setStep(3)} className="btn-secondary">
                  VIEW PIT WALL
                </button>
              </div>
            </div>
          )}

          {/* STEP 2: REGISTRATION FORM */}
          {step === 2 && (
            <div className="terminal-content">
              <button onClick={() => setStep(1)} className="btn-back">
                <ArrowBackIosNewIcon style={{ fontSize: '12px' }} /> BACK
              </button>
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '30px' }}>{'>'} STRATEGIST_REGISTRATION</h2>
              <div style={{ display: 'grid', gap: '20px' }}>
                <div className="input-group">
                  <label>USER_ID (NAME)</label>
                  <input name="name" value={formData.name} onChange={handleInputChange} />
                </div>
                <div className="input-group">
                  <label>CONSTRUCTOR (TEAM)</label>
                  <select name="team" value={formData.team} onChange={handleTeamChange}>
                    <option value="">Select Team</option>
                    {Object.keys(f1Data).sort().map(team => <option key={team} value={team}>{team}</option>)}
                  </select>
                </div>
                <div className="input-group">
                  <label>PILOT (DRIVER)</label>
                  <select name="driver" value={formData.driver} onChange={handleInputChange} disabled={!formData.team}>
                    <option value="">{formData.team ? 'Select Driver' : 'Select Team First'}</option>
                    {formData.team && f1Data[formData.team].map(driver => <option key={driver} value={driver}>{driver}</option>)}
                  </select>
                </div>
                <button onClick={() => setStep(3)} className="btn-primary">LOCK STRATEGY & DEPLOY</button>
              </div>
            </div>
          )}

          {/* STEP 3: PIT WALL RESULTS */}
          {step === 3 && (
            <div className="terminal-content">
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
                <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', margin: 0 }}>{'>'} RACE_CONTROL_WALL</h2>
                <button onClick={() => setStep(1)} className="btn-back">RESET_COMMS</button>
              </div>
              <div className="voter-grid" style={{ 
                display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))', gap: '20px' 
              }}>
                {voterData.map((vote) => (
                  <div key={vote.id} className="voter-card" style={{ 
                    background: '#2C2C2C', padding: '20px', borderLeft: '4px solid #FF7A1A' 
                  }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '0.7rem', color: '#6B7280' }}>
                      <span>{vote.timestamp}</span>
                      <span style={{ color: '#FF7A1A', fontWeight: 800 }}>{vote.team}</span>
                    </div>
                    <div style={{ color: '#FAFAF8', fontSize: '1.1rem', fontWeight: 800, margin: '10px 0' }}>{vote.name.toUpperCase()}</div>
                    <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '0.8rem' }}>
                      <span style={{ color: '#6B7280' }}>PILOT</span>
                      <span style={{ color: '#FF7A1A', fontWeight: 700 }}>{vote.driver}</span>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default GridEntry;
